import { connect } from 'react-redux';
import * as partiesActions from '../../actions/partiesActions';
import React from 'react';


class partiesList extends React.Component {

  componentWillMount(){
    this.props.partiesActions();
  }
  renderData() {
    return <div>{this.props.parties}</div>;
  }


  render() {
    return (
      <div className="">
          {this.props.parties.length > 0 ?
            this.renderData()
            :
            <div className="">
              No Data
            </div>
          }
      </div>
    );
  }
}

function mapStateToProps(state) {
  return {
    parties: state.parties.parties
  };
}

function mapDispatchToProps(dispatch) {
  return {
    partiesActions: () => {
      dispatch(partiesActions.fetchParties)
    }
  };
}

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(partiesList);
